  popup: {
    background: "#fff",
    padding: "20px",
    borderRadius: "12px",
    boxShadow: "0 4px 10px rgba(0, 0, 0, 0.3)",
    textAlign: "center",
    minWidth: "250px",
  },
  button: {
    marginTop: "12px",
    padding: "8px 16px",
    border: "none",
    borderRadius: "6px",
    backgroundColor: "#000",
    color: "#fff",
    cursor: "pointer",
  },
};

export default FeaturePopup;
